import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import "./styles.css";

function App() {
    const useStyles = makeStyles((theme) => ({
        root: {
            "& .MuiFormLabel-root": {
                width: "200px",
                color: "red",
                margin: "normal",
            },
        },
    }));

    const inputProps = {
        color: "red",
    };

    const classes = useStyles();
    return (
        <div className="App">
            <div className="row no-gutters">
                <div
                    className="col no-gutters"
                    style={{
                        backgroundImage: `url("wallpaper.jpg")`,
                        backgroundSize: "cover",
                    }}
                >
                    <div className="leftside-title">
                        <p style={{ fontSize: "28px" }}>Bonjour à tous</p>
                        <p style={{ fontSize: "18px" }}>
                            Bienvenue sur Lamster !
                        </p>
                    </div>
                    <div className="social-link-footer">
                        <img
                            className="social-link-icon "
                            style={{
                                width: "20px",
                                height: "3Opx",
                            }}
                            src="twitter.svg"
                            alt="display image"
                        />
                        <img
                            className="social-link-icon "
                            style={{
                                width: "20px",
                                height: "3Opx",
                            }}
                            src="facebook.svg"
                            alt="display image"
                        />
                        <img
                            className="social-link-icon "
                            style={{
                                width: "20px",
                                height: "3Opx",
                            }}
                            src="instagram.svg"
                            alt="display image"
                        />
                    </div>
                </div>
                <div className="col no-gutters">
                    <div className="rightside">
                        <div
                            style={{
                                color: "white",
                                margin: "15px",
                                float: "right",
                            }}
                        >
                            S'inscrire
                        </div>
                        <div className="form">
                            <div>
                                <img
                                    className=""
                                    style={{
                                        width: "200px",
                                        height: "30Opx",
                                        margin: "auto",
                                        display: "block",
                                    }}
                                    src="brand_name.svg"
                                    alt="brand_name"
                                />
                            </div>
                            <div
                                style={{
                                    fontSize: "14px",
                                    textAlign: "center",
                                    marginTop: "10px",
                                }}
                            >
                                Nous sommes très heureux de vous revoir!
                            </div>
                            <div>
                                <form>
                                    <div>
                                        <TextField
                                            className={classes.root}
                                            id="outlined-basic"
                                            label="Adresse mail"
                                            variant="outlined"
                                        />
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default App;
